import Header from "./components/Header";
import Left from "./components/Left";
import Right from "./components/Right";
import Dashboard from "./components/Dashboard";
function App() {
  return (
    <>
      <Header />
      <aside>
      <Left />
      </aside>
      <Right />
      <Dashboard />
    </>
  );
}

export default App;
